import React from 'react';
import '../styles/TopicList.css';

function TopicList({ themes, onThemeClick }) {
  return (
    <div className="topic-list">
      <h3>Topics</h3>
      <ul>
        {themes.map((theme) => (
          <li key={theme.id} onClick={() => onThemeClick(theme)}>
            {theme.name}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default TopicList;
